(374, 'Butterfly Effect Festival', '2018-07-28', '2018-07-29', '', '08:00:59', '23:00:59', 'Welcome to The Butterfly Effect Festival  A two-day ticketed music festival showcasing some of the best of what garage, house music and Urban beats has to offer, including top UK artists.\n\nCroydon has always been at the heart of the UK music industry and we feel it is now time to truly celebrate and pay homage to one of musics most influential places. The city is home to The Brits School, which has honed and trained artists like Amy Whinehouse and Adele, including emerging talent such as Stormzy, Krept & Konan and Big Shaq, who have managed to cultivate an international following, right on the streets of Thornton Heath.\n\nWe call the festival The Butterfly Effect because we believe small causes truly do have larger effects. Through the festival, we aim to inspire and create opportunities to grow with many music generations to come', 'Lloyds Park', 4, '1530871326685.515869.png', '1530871326769.365967.png', 109, 1, 2, 2, 2, 'public', 'other', 'Croydon', '', 1, 1, 1, '2018-07-06 10:02:29', '2018-07-06 10:02:29'),
